import React from "react";
import AppBar from "@material-ui/core/CssBaseline";
import Toolbar from "@material-ui/core/CssBaseline";


const Header = () => {
  return (
    <div>
      <AppBar position="static" >
        <Toolbar>
          <h1>Carousel</h1>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default Header;
